    string strMenu = "OpeningStock";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {

        Email = await sessionStorage.GetItemAsync<string>("Email");
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        UserId = await sessionStorage.GetItemAsync<long>("UserId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Error);
                //Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    private void LoadData()
    {
        setting = settingRepository.EditInventorySetting(decSettingVoucherId);
        product = productrepository.EditProductOpeningStock(Convert.ToInt64(id));
        listProduct = productrepository.ViewAllProduct(CompanyId);
        if (product.ProductId > 0)
        {
            listUnit = purchaseRepository.GetProducttounit(product.ProductId);
            listBatch = purchaseRepository.GetProducttoBatch(product.ProductId);
        }
    }
    protected void ProductClicked()
    {
        if (product.ProductId > 0)
        {
            listUnit = purchaseRepository.GetProducttounit(product.ProductId);
            listBatch = purchaseRepository.GetProducttoBatch(product.ProductId);
        }
        else
        {
            product.UnitId = 0;
            product.BatchId = 0;
        }

        this.StateHasChanged();
    }
    public void SaveProduct()
    {
        string strManu = DreamerDateConveter.convertToBS(DateTime.Now);
        string strExp = DreamerDateConveter.convertToBS(DateTime.Now);
        if (strAdd == true)
        {
            if (product.ProductId == 0)
            {
                Snackbar.Add("Choose Product.", Severity.Info);
            }
            else if (product.UnitId == 0)
            {
                Snackbar.Add("Choose Unit.", Severity.Info);
            }
            else if (product.Qty == 0)
            {
                Snackbar.Add("Enter Qty", Severity.Info);
            }
            else
            {
                SqlConnection sqlcon = new SqlConnection(_conn.DbConn);
                sqlcon.Open();
                SqlTransaction sql = sqlcon.BeginTransaction();


                //StockPosting
                var parastock = new DynamicParameters();
                parastock.Add("@StockPostingId", product.StockPostingId);
                parastock.Add("@BatchId", product.BatchId);
                parastock.Add("@Date", DateTime.Now);
                parastock.Add("@NepaliDate", strManu);
                parastock.Add("@CompanyId", CompanyId);
                parastock.Add("@FinancialYearId", FinancialYearId);
                parastock.Add("@LedgerId", 0);
                parastock.Add("@GodownId", 1);
                parastock.Add("@InwardQty", product.Qty);
                parastock.Add("@OutwardQty", 0);
                parastock.Add("@ProductId", product.ProductId);
                parastock.Add("@RackId", 1);
                parastock.Add("@Rate", product.Rate);
                parastock.Add("@UnitId", product.UnitId);
                parastock.Add("@DetailsId", product.ProductId);
                parastock.Add("@InvoiceNo", product.ProductId);
                parastock.Add("@VoucherNo", product.ProductId);
                parastock.Add("@VoucherTypeId", 2);
                parastock.Add("@AgainstInvoiceNo", "NA");
                parastock.Add("@AgainstVoucherNo", "NA");
                parastock.Add("@AgainstVoucherTypeId", 0);
                parastock.Add("@StockCalculate", "Opening");
                parastock.Add("@ModifyDate", DateTime.Now);
                var valuesStock = sqlcon.Query<long>("StockPostingUpdate", parastock, sql, true, 0, commandType: CommandType.StoredProcedure);


                sql.Commit();
                Snackbar.Add("Saved Successfully.", Severity.Success);
                LoadData();
                navManager.NavigateTo("inventory/openingstock");
            }
        }
        else
        {
            Snackbar.Add("You dont have to privilege.", Severity.Error);
            //Toaster.Add("You dont have to privilege.", MatToastType.Success, "Dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }
    void Cancel()
    {
        navManager.NavigateTo("inventory/openingstock");
    }

